コペン LA400K レザーコンソールカバー 鍵穴無 ブラック 
<br /> 
<br /> 5ウレタンクッションを純正のコンソールカバーに乗せ、合皮レザーを張りました。 
<br /> 純正より熱を持ちにくく、肘を乗せた時の感触や肌触りも抜群です。 
<br /> 肉厚クッションを挟んでおりますので、使用感が抜群です。 
<br /> 安価なカバーと違い、純正部品を使用した完成品なので、非常に高級感があります。 
<br /> 難しい作業や純正品加工等は、一切必要ありません！！ 
<br /> 純正コンソールカバーをドライバーで外して頂き、本製品と付け替えるだけの長簡単作業です。 
<br /> ※脱着時にネジの紛失や破損等、細心の注意をはらって作業をおこなって下さい。 
<br /> 職人によるハンドメイド品ですので、カバーとは違う高級感漂うこだわりの逸品です。 
<br /> 
<br /> トレー部分と鍵穴を埋め、肘掛としての機能を重視したモデルとなります。 
<br /> 鍵穴も隠れてしまいますので、オープン時のセキュリティは十分にご注意ください。 
<br /> ※別商品にて鍵穴有りの商品も販売中です。 
<br /> 
<br /> カラー　：　ブラックレザー（合皮） 
<br /> ステッチカラー　：　レッド 
<br /> 日本製 
